import React from "react";
import "./about.css";

const About = () => {
  return (
    <div className="about-us-page">
      <h1>Our mission</h1>
      <p className="quote">Keep calm and nail it!</p>
      <p>
        We want to deliver the nail exam preraration tool with quality that is
        unbeatable in Washingron area. Our principle is to focus on the training
        of recent nail's school graduets, so they are always up to date with the
        newest board exam preparation information. We believe in strong
        management and continuous self-development. We want to help you to
        celebrate yourself in your real, most raw, authentic brilliance, who
        believes in yourselves and are ready to step into the carier you love.
      </p>
    </div>
  );
};

export default About;
